import React from "react";
import { useTheme, ThemeProvider } from "../themeProvider/"; // Adjust the import path as needed

function Header() {
  const { theme, toggleTheme } = useTheme();

  return (
    <header>
      {/* Your header content */}
      <button
        onClick={toggleTheme}
        style={{
          padding: "8px 16px",
          fontSize: "16px",
          border: "none",
          borderRadius: "4px",
          cursor: "pointer",
          backgroundColor: theme === "light" ? "#333" : "#ccc",
          color: theme === "light" ? "#fff" : "#000",
        }}
      >
        Toggle Theme
      </button>
    </header>
  );
}

export default Header;
